import styled from "styled-components";



const ContainerCadastroCliente = styled.div`
    display: flex;
    flex-direction: column;
    align-items: left;
    position: absolute;
    padding-top: 20px;
    left: 180px;

    &.oculto {
        display:none;
    }

`;

export default ContainerCadastroCliente;
